ption:"Canva est une plate-forme de graphisme utilisée pour la création de graphismes destinés aux réseaux sociaux, de présentations, de documents et d'autres contenus visuels, y compris des modèles. Elle collecte des données nécessaires à la prestation de ce service et à des fins d'analyse et de personnalisation. Ces données incluent l'adresse IP du visiteur du site, l'URL d'orientation, les pages consultées, les données d'utilisation, le nombre de clics, les identificateurs de l'appareil, l'emplacement géographique, les informations sur le système d'exploitation et les informations sur le navigateur.\nNom et durée de vie des cookies : __cfruid (durée de vie : 1 session), __cf_bm (durée de vie : 30 minutes)",cmsCookieBannerIFrameAppDailymotionVideoDescription:"Dailymotion est une plate-forme de partage de vidéos sur laquelle les utilisateurs peuvent importer, publier et partager des vidéos. Elle collecte des données à des fins de publicité, personnalisation, fonctionnalité, analyse et optimisation.\nNom et durée de vie des cookies : dmvk (durée de vie : 1 session), ts (durée de vie : 2 ans), usprivacy (durée de vie : 2 ans), v1st (durée de vie : 2 ans)",cmsCookieBannerIFrameAppDribbbleDescription:"Dribble est une plate-forme d'auto-promotion et de réseau social pour les créatifs et les infographistes. Elle permet de présenter son portfolio de designs, de publier des offres d'emploi et de recruter des talents. C'est l'une des plus grandes plates-formes en ligne de partage de designs pour les créatifs.",cmsCookieBannerIFrameAppFacebookPostDescription:"Ce plug-in du réseau social Facebook vous permet d'intégrer du contenu Facebook dans des sites tiers. Il collecte des données pour intégrer les fonctions Facebook à des fins de publicité, optimisation et personnalisation. Ces données incluent les données d'utilisation du visiteur, les informations sur le navigateur, la date et l'heure de visite, l'identifiant utilisateur Facebook, les sites visités et l'en-tête HTTP.",c